import logo from '../../assets/logos/c-plusplus.svg';

const ActivityTab = () => {
	return (
		<div>
			<h1 style={{ color: 'white' }}>Activity Tab!</h1>
			<img src={logo} alt="" className="logo" />
		</div>
	);
};

export default ActivityTab;
